Chitose is a high school baseball player who had to abandon baseball due to injury. 
One day, when Chitose was spending a boring day off without any goal, Chitose's life changed completely with a &quot;VRMMO game&quot; that was suddenly sent by his sister Haruka! &ldquo;Oy Onii-chan, let's play a game together in our spare time!&rdquo; 
A high school baseball player became a gamer at the invitation of his cute sister! ? Using his &quot;excellent baseball sense&quot; to enjoy a fun game in a VR world!

