&quot;I couldn't help falling for that earnest boy!&quot;

I confessed. I couldn't do it while sober so I took a shot of liquid courage. 

&ldquo;I like you.&rdquo;
&ldquo;Why?&rdquo;
&ldquo;I just like everything about you.&rdquo;
&ldquo;... I don't understand.&rdquo;

Something's strange. His voice is deeper, his height slightly different, and his physique even more so. In fact, after a closer look, even the hair colour that reflected the moonlight⁠&mdash;this is crazy. It&rsquo;s someone else. It's none other than Duke Cabel Willard who's known as the 'Grim Reaper' of the battlefields. 

&ldquo;Cabel.&rdquo;
&ldquo;... Excuse me?&rdquo;
&ldquo;From now on, don't refer to me by any strange titles. Call me by name instead.&rdquo;

The corners of his lips that were always frozen stiff curved into a smile. It seemed like he would immediately kill me if the truth of my false confession was brought to light.

