Hagure Narihira is your average hopeless romantic sophomore in a magical high school for power users. He has no friends and has a crappy ability called the &quot;drain&quot; that absorbs human energy within a radius of 1 meter, unconsciously with his ability. Because of this &quot;special ability&quot;, no one wanted to be his friend much less his girlfriend.

&quot;Isn't it strange that power users with abilities creepier than mine can make friends? This world is unfair!&quot;

It was at that moment when his feelings where on the verge of exploding that Takawashi Enju,  the girl with the poisonous tongue who everyone in school knew as the &quot;ice princess,&quot; spoke out to him. When Narihira discovers her secret by chance, she suggests that they form an alliance with the purpose of making friends. The unexpected proposal causes his heart to dance, however, he had forgotten one important thing... birds of a feather flock together.

It is supposed to be the peak of Urara Namita's life. But she is losing her house, savings, and boyfriend instead! In such despair situation, her rival in the workplace, Musashi Fudou suddenly came to her with the most unexpected proposal &mdash; &ldquo;Why don't you live here with me for a while...?&rdquo;

Well, he does look like a bully sometimes, although he is also very kind to her. &ldquo;I supposed to hate him, but seeing his weak face makes me feel something different...&rdquo;

